	hooks = []byte( "# Hooks are a way to run arbitrary Wingo commands whenever a certain event\n# occurs. The idea is to specify a set of match conditions and a set of\n# commands that are executed for some particular event. Match conditions are\n# run when the event occurs, and if the match conditions executes successfully,\n# the associated commands are executed.\n#\n# The following hooks are allowed:\n# startup, restart, managed, focused, unfocused\n#\n# (I'd like to add more hooks. But I'd rather add too few than add too many.)\n#\n# A hook is started with some label like \"[MyHookName]\". The label can be\n# anything, and is used in the Wingo logs when you need to debug your hook.\n# (This requires running wingo with `--log-level 4`, which generates a lot\n# of noise in the logs. But grep'ing for your hook name should cut through\n# the noise quite nicely.)\n#\n# Every hook also needs a \"match\" option set. A hook that always matches\n# can be specified with \"match := True\". A hook that never matches can be\n# specified with \"match := False\". The \"match\" option must be set to commands\n# that return either a 0 or a 1. Namely, such commands can be found with the\n# prefix \"Match\", like \"MatchClientName\". There are also logical commands\n# \"Not\", \"Or\" and \"And\" to help you form more complex conditions. Finally,\n# multiple match conditions can be specified by simply adding more with\n# subsequent assignments to \"match\".\n#\n# All commands attached to \"match\" are combined conjunctively. That is, all\n# match conditions must return \"1\" in order for the hook to fire. Alternatively,\n# if the \"conjunction\" option is set to \"no\", the commands will be combined\n# disjunctively. That is, at least one match condition must return \"1\" in\n# order for the hook to fire.\n#\n# In order to specify the commands to run when the hook fires, you'll need to\n# add them to the particular hook group listed above (i.e., \"startup\" or\n# \"focused\".) This works just like \"match\", in that you can add commands to\n# execute by adding them with successive definitions of \"hook_group := ...\".\n#\n# Finally, the special string \":client:\" is replaced in every command by the\n# client that executed the hook. (If it's appropriate. For instance, no\n# substitution will occur on the \"startup\" hook.)\n#\n# Let's walk through an example that, in simple terms, tries to match a\n# terminal window and then maximize it and removes its decorations\n# when it's first managed.\n#\n# -------------------------------------------------------\n# [MaximizeTerminals]\n# match := MatchClientClass \":client:\" \"lxterminal\"\n# match := MatchClientClass \":client:\" \"konsole\"\n# match := MatchClientClass \":client:\" \"urxvt\"\n# match := MatchClientClass \":client:\" \"xterm\"\n# match := MatchClientClass \":client:\" \"gnome-terminal\"\n#\n# conjunction := no\n#\n# managed := FrameSlim \":client:\"\n# managed := Maximize \":client:\"\n# -------------------------------------------------------\n#\n# Here we name our hook \"MaximizeTerminals\". (You'll see this name if there was\n# problem setting up your hook.) We specify 5 different command match\n# conditions, and disable conjunctive evaluation, so that only ONE of the match\n# commands needs to return true in order for the managed hook to fire. If we\n# didn't disable conjuctive evaluation, then no window would ever be able to\n# match our conditions.\n#\n# Finally, we set the \"managed\" hook to run the commands 'FrameSlim \":client:\"'\n# and 'Maximize \":client:\"'. The special \":client:\" string will be replaced\n# with the id of the client that was managed. (You can think of \":client:\" as\n# semantically equivalent to a preprocessor macro.)\n\n[Autostart]\nmatch := True\n\n# You can add startup programs here if you like.\n#startup := Shell \"xterm\"\n\n# You can add more by just adding another definition of \"startup\".\n#startup := Shell \"gkrellm\"\n\n# Easter egg!\nstartup := Dale\n\n[ForceFloating]\n# This hook matches certain windows, and forces them into the floating layout.\n# You probably don't need to add windows like \"gmrun\" or \"krunner\", since\n# they are automatically inferred to be floating.\nmatch := MatchClientClass \":client:\" \"gimp\"\n\n# Typically match conditions are combined as a set of conjunctions. That is,\n# all match conditions must be met for the hook to fire. But here, we want\n# to fire the hook if *any* of the match conditions match, so we disable\n# the default conjunction mode.\nconjunction := no\n\n# Just make sure it's floating.\nmanaged := Float \":client:\"\n\n[FocusTransparency]\n# If you have a compositing manager running, this will use transparency\n# to indicate focus.\nmatch := True\n\nfocused := SetOpacity \":client:\" 1.0\nunfocused := SetOpacity \":client:\" 0.85\n\n[StupidKDE]\n# This hook is to make sure the KDE splash window isn't decorated on startup.\n# Unfortunately, it appears the KDE folks don't care to let us know this fact\n# in a standard way...\nmatch := MatchClientClass \":client:\" \"ksplashx\"\n\nmanaged := FrameNada \":client:\"\n\n")
	key = []byte( "# This is where all key bindings are specified. Mouse bindings are specified\n# in mouse.wini.\n#\n# Key bindings work by specifying a key combination (left side of \":=\") that\n# will execute a command (right side of \":=\") when pressed. Commands in this\n# case are Wingo commands (the Gribble language). There are *a lot* of commands\n# available to you---only a small subset are shown below in the default\n# configuration.\n#\n#\n# Key combinations\n# ----------------\n# Key combinations are specified as \"[Mod[-Mod[...]]-]KEY\", where \"mod\"\n# corresponds to a key modifier like \"Mod1\" or \"Control\", and \"KEY\" corresponds\n# to a key symbol on your keyboard like \"a\" or \"Return\" or \"plus\". A full\n# list of key symbols can be found here: http://goo.gl/MYd7G --- you could\n# also discover them by running the 'xev' command and pressing the keys.\n#\n#\n# Modifiers\n# ---------\n# Since most keys on the keyboard have their own particular function, it is\n# usually necessary to bind key presses in combination with some modifier key\n# like \"Shift\", \"Control\", \"Alt\" or \"Super\" (i.e., the window key). In order\n# to know which keys are bound to particular modifiers on your system, you\n# should run the `xmodmap` command. The left hand column lists the modifiers\n# you should use in this file, while the right columns list the key symbols\n# bound to those modifiers.\n#\n# In general, if you haven't tweaked your configuration, the mapping probably\n# looks something like this:\n#\n#     shift   -> Shift\n#     control -> Control\n#     mod1    -> alt\n#     mod4    -> super (the \"windows\" key)\n#\n#\n# Where's the beef?\n# -----------------\n# Wingo has a lot of commands, and they can all be inspected either in Wingo\n# itself with the `WingoHelp` command (by default bound to \"Mod1-Shift-h\") or\n# with the `wingo-cmd` utility.\n#\n# With `wingo-cmd`, you can get a list of every command and the type of\n# parameters they accept:\n#\n#     wingo-cmd --list-types\n#\n# Or you can see a list of all commands with a description of each:\n#\n#     wingo-cmd --list-usage\n#\n# Or you can see the details of a particular command:\n#\n#     wingo-cmd --usage WorkspaceGreedy\n#\n# If you don't have `wingo-cmd` available on your system, and you installed\n# Wingo with `go get`, then `go get github.com/BurntSushi/wingo/wingo-cmd`\n# should install wingo-cmd for you. If you *didn't* install Wingo with `go\n# get`, then presumably you need to speak to the package maintainer in charge\n# of the package.\n\n\n[Global]\n# Set up some common key bindings. \"Shell\" is Wingo's command for executing\n# shell commands. In practice, I strongly recommend using `xbindkeys` to\n# configure shortcuts for running programs. It's more mature and will work\n# with *any* window manager.\n#\n# Commands are run with bash like so: `bash -c \"{COMMAND}\"`. Double quotes can\n# be escaped with a backslash, e.g., \\\".\n#\n# N.B. The shell used can be changed in `options.wini`.\nMod1-t := Shell \"aterm\"\nMod1-return := Shell \"aterm\"\nMod1-F2 := Shell \"gmrun\"\n\n# You could also use Wingo's Shell command to execute commands on the fly.\n# In all likelihood, you should use a real launcher like `gmrun` or `dmenu`.\n# Mod1-r := Shell (Input \"Command:\")\n\n# Some basic window manager commands. Closing/maximizing can also be done with\n# buttons on fully decorated windows.\nMod1-c := Close (GetActive)\nMod1-Shift-c := Quit\nMod1-q := Quit\nMod1-x := ToggleMaximize (GetActive)\nMod1-f := ToggleFloating (GetActive)\nMod1-s := ToggleSticky (GetActive)\n\n# WingoExec will allow you to execute *any* Wingo command.\nMod1-Shift-r := WingoExec (Input \"Wingo command:\")\n\n# WingoHelp will show you everything you could possibly want to know about\n# any of Wingo's commands.\nMod1-Shift-h := WingoHelp (Input \"Wingo command name:\")\n\n# Execute a script from an input prompt.\n# Scripts are executable files in your $XDG_CONFIG_HOME/wingo/scripts directory.\nMod1-Shift-s := Script (Input \"Script command:\")\n\n# Allows you to specify precisely which layout you want to be active.\nMod1-Shift-l := SetLayout (GetWorkspace) (Input \"Layout name:\")\n\n# Add and remove workspaces.\n# Note that a workspace MUST be empty before it can be removed. (Don't worry,\n# Wingo won't let you do it even if you try :P)\nMod1-Shift-a := AddWorkspace (Input \"New workspace name:\")\nMod1-BackSpace := RemoveWorkspace (GetWorkspace)\n\n# An alternative version of AddWorkspace that will add a new workspace given\n# some input, and then automatically switch to it. This shows a lesser known\n# feature where some commands return relevant values that can be re-used in\n# other commands. In this case, `AddWorkspace` returns the name of the\n# workspace added.\n# Mod1-Shift-a := Workspace (AddWorkspace (Input \"New workspace name:\"))\n\n# Your basic Workspace commands.\n# Note that these commands become extremely awkward in a multi-head setup,\n# particularly because a different workspace is visible on each monitor.\nMod1-left := Workspace (GetWorkspacePrev)\nMod1-right := Workspace (GetWorkspaceNext)\nMod1-Shift-left := WorkspaceWithClient (GetWorkspacePrev) (GetActive)\nMod1-Shift-right := WorkspaceWithClient (GetWorkspaceNext) (GetActive)\n\n# Switch to a particular workspace \"greedily\". A greedy workspace switch\n# *always* brings the workspace specified to the current monitor. When the\n# workspace is hidden, there is no difference between a regular switch and\n# a greedy switch. But when the workspace is visible on another monitor,\n# a greedy switch will flip the workspaces whereas a regular switch will\n# move focus to the monitor that the workspace is on.\n# (This is exactly like a greedy switch in Xmonad.)\nMod1-1 := WorkspaceGreedy \"1\"\nMod1-2 := WorkspaceGreedy \"2\"\nMod1-3 := WorkspaceGreedy \"3\"\nMod1-4 := WorkspaceGreedy \"4\"\n\n# Same as above, but bring the active window with us.\nMod1-Shift-1 := WorkspaceGreedyWithClient \"1\" (GetActive)\nMod1-Shift-2 := WorkspaceGreedyWithClient \"2\" (GetActive)\nMod1-Shift-3 := WorkspaceGreedyWithClient \"3\" (GetActive)\nMod1-Shift-4 := WorkspaceGreedyWithClient \"4\" (GetActive)\n\n# Move focus to the workspace on the corresponding monitor. Monitor indices\n# start at 0 and are ordered by left to right, and then top to bottom.\n# (We also move the pointer with the focus.)\n# Bonus: Triple monitors on Linux: http://goo.gl/nmW6v\nMod1-w := HeadFocus 0\nMod1-w := MovePointerRelative 0 0\nMod1-e := HeadFocus 1\nMod1-e := MovePointerRelative 0 0\nMod1-r := HeadFocus 2\nMod1-r := MovePointerRelative 0 0\n\n# Move focus and the current client to a particular monitor.\nMod1-Shift-w := HeadFocusWithClient 0 (GetActive)\nMod1-Shift-w := MovePointerRelative 0 0\nMod1-Shift-e := HeadFocusWithClient 1 (GetActive)\nMod1-Shift-e := MovePointerRelative 0 0\nMod1-Shift-r := HeadFocusWithClient 2 (GetActive)\nMod1-Shift-r := MovePointerRelative 0 0\n\n# Your every day Alt-Tab. Use WingoHelp or `wingo-cmd --usage CycleClientNext`\n# to discover what each of the parameters means. (They specify which kinds of\n# clients should be shown.)\nMod1-Tab := CycleClientNext \"yes\" \"no\" \"yes\"\nMod1-Shift-Tab := CycleClientPrev \"yes\" \"no\" \"yes\"\n\n# List all windows and focus/raise the selected client.\nMod1-space := FocusRaise (SelectClient \"Any\" \"no\" \"no\" \"yes\")\n\n# List all workspaces, and greedily switch to the one selected.\n# Mod1-return := WorkspaceGreedy (SelectWorkspace \"Prefix\")\n\n# List all workspaces, and greedily switch to the one selected with the\n# active window.\nMod1-Shift-return := WorkspaceGreedyWithClient \\\n                       (SelectWorkspace \"Prefix\") \\\n                       (GetActive)\n\n# Basic auto tiling commands. Auto tiling layouts are split into two panes:\n# \"masters\" and \"slaves\". The commands below revolve around adjusting the size\n# of those two panes, adding/removing windows from those panes, etc.\nMod1-a := AutoTile (GetWorkspace)\nMod1-u := AutoUntile (GetWorkspace)\nMod1-z := AutoCycle (GetWorkspace)\nMod1-h := AutoResizeMaster (GetWorkspace) -0.02\nMod1-l := AutoResizeMaster (GetWorkspace) 0.02\nMod1-b := AutoResizeWindow (GetWorkspace) -0.02\nMod1-n := AutoResizeWindow (GetWorkspace) 0.02\nMod1-k := AutoNext (GetWorkspace)\nMod1-j := AutoPrev (GetWorkspace)\nMod1-Shift-k := AutoSwitchNext (GetWorkspace)\nMod1-Shift-j := AutoSwitchPrev (GetWorkspace)\nMod1-m := AutoMaster (GetWorkspace)\nMod1-Shift-return := AutoMakeMaster (GetWorkspace)\nMod1-comma := AutoMastersFewer (GetWorkspace)\nMod1-period := AutoMastersMore (GetWorkspace)\n\n")
	mouse = []byte( "# This is the mouse configuration file, which controls *all* of the mouse\n# controls found in Wingo. The idea is to set a button combination (left side\n# of \":=\") to a command (right side of \":=\").\n#\n# Basically, each distinct region of a window can have its own mouse commands\n# defined. Regions are defined as \"[ ... ]\" sections below. And just like\n# in the key configuration, more than one command can be assigned to a\n# particular button combination by using successive definitions.\n#\n# The default mouse configuration isn't that interesting, and is clearly\n# intended to work well with a regular floating window manager. However, since\n# all commands are available here, you could combine tiling with the mouse.\n# (Say what!?!?)\n#\n#\n# Buttons\n# -------\n# Button combinations are specified as \"[Mod[-Mod[...]]-]BUTTONNUMBER\" where\n# \"mod\" corresponds to a modifier like \"Mod1\" or \"Control\". Examples of button\n# combinations are \"1\", \"Mod4-3\", \"Control-Shift-3\".\n#\n# Usually \"1\" corresponds to left click, \"3\" corresponds to right click and\n# \"2\" corresponds to middle. Scroll wheels are usually \"4\" and \"5\". If you have\n# more buttons, use the `xev` program and click in the window that shows up\n# with the button. Read the event data and look for \"button NUMBER\".\n#\n# Also, if you add \"up\" after the button combination, the command will be\n# executed when the button is *released*. Otherwise, the command is executed\n# when the button is *pressed*. This is useful to keep behavior with window\n# buttons similar to how buttons are pressed every where else.\n#\n#\n# Modifiers\n# ---------\n# Modifiers for mouse buttons work just like modifiers for key bindings.\n# See the \"Modifiers\" section in key.wini for the full scoop.\n#\n# TL;DR - Run `xmodmap` and use the names in the left column which line up\n#         to the actual keys you want to use. Mod1 is usually \"alt\" and Mod4\n#         is usually \"Super\" (the windows key). \"Shift\" and \"Control\" usually\n#         map to what you'd expect.\n#\n#\n# Special mouse commands\n# ----------------------\n# Two of the commands found below are special and can ONLY be used here in\n# mouse.wini. Those commands are \"MouseMove\" and \"MouseResize\". They are\n# special because of the way drag handling has been set up in Wingo. (It's not\n# very flexible.)\n#\n# If you want to move/resize windows without those commands, you'll have to\n# use the \"Move\" or \"Resize\" commands.\n#\n#\n# What is \":mouse:\"?\n# ------------------\n# It is a special string (i.e., a terrible hack) that is replaced with the\n# client associated with the mouse press. Something similar is done in\n# hooks.wini.\n\n\n[Root]\n1 := Focus \":mouse:\"\n\n# Here's an example of changing the workspace with your scroll wheel.\n# Mod4-4 := Workspace (GetWorkspaceNext)\n# Mod4-5 := Workspace (GetWorkspacePrev)\n\n[Client]\n1 := FocusRaise \":mouse:\"\n\n[Frame]\nMod4-1 := MouseMove\nMod4-3 := MouseResize \"Infer\"\n\n# Here's an example of binding to the mouse scroll wheel.\n# (If a compositing manager is running, this will allow you to adjust the\n# opacity of a window with your scroll wheel.)\n# Mod4-4 := Shell \"transset-df -p --max 1.0 --inc 0.05\"\n# Mod4-5 := Shell \"transset-df -p --min 0.1 --dec 0.05\"\n\n[FullIcon]\n1 := MouseMove\n1 := FocusRaise \":mouse:\"\n3 := MouseResize \"Infer\"\n\n[FullTitleText]\n1 := MouseMove\n1 := FocusRaise \":mouse:\"\n3 := MouseResize \"Infer\"\n\n[FullTitleBar]\n1 := MouseMove\n1 := FocusRaise \":mouse:\"\n3 := MouseResize \"Infer\"\n\n[FullClose]\n1 up := Close \":mouse:\"\n\n[FullMaximize]\n1 up := ToggleMaximize \":mouse:\"\n\n[FullMinimize]\n1 up := ToggleIconify \":mouse:\"\n\n[FullTop]\n1 := MouseResize \"Top\"\n1 := FocusRaise \":mouse:\"\n\n[FullTitleBottom]\n1 := FocusRaise \":mouse:\"\n\n[FullBottom]\n1 := MouseResize \"Bottom\"\n1 := FocusRaise \":mouse:\"\n\n[FullLeft]\n1 := MouseResize \"Left\"\n1 := FocusRaise \":mouse:\"\n\n[FullRight]\n1 := MouseResize \"Right\"\n1 := FocusRaise \":mouse:\"\n\n[FullTopLeft]\n1 := MouseResize \"TopLeft\"\n1 := FocusRaise \":mouse:\"\n\n[FullTopRight]\n1 := MouseResize \"TopRight\"\n1 := FocusRaise \":mouse:\"\n\n[FullBottomLeft]\n1 := MouseResize \"BottomLeft\"\n1 := FocusRaise \":mouse:\"\n\n[FullBottomRight]\n1 := MouseResize \"BottomRight\"\n1 := FocusRaise \":mouse:\"\n\n[BordersTop]\n1 := MouseResize \"Top\"\n1 := FocusRaise \":mouse:\"\n\n[BordersBottom]\n1 := MouseResize \"Bottom\"\n1 := FocusRaise \":mouse:\"\n\n[BordersLeft]\n1 := MouseResize \"Left\"\n1 := FocusRaise \":mouse:\"\n\n[BordersRight]\n1 := MouseResize \"Right\"\n1 := FocusRaise \":mouse:\"\n\n[BordersTopLeft]\n1 := MouseResize \"TopLeft\"\n1 := FocusRaise \":mouse:\"\n\n[BordersTopRight]\n1 := MouseResize \"TopRight\"\n1 := FocusRaise \":mouse:\"\n\n[BordersBottomLeft]\n1 := MouseResize \"BottomLeft\"\n1 := FocusRaise \":mouse:\"\n\n[BordersBottomRight]\n1 := MouseResize \"BottomRight\"\n1 := FocusRaise \":mouse:\"\n\n")
	options = []byte( "# These are some global configuration options for Wingo. It may not look like\n# there's a lot here, but that's because a lot of the configuration is done\n# with your key/mouse bindings, and your theme settings.\n\n[Options]\n# The list of workspaces to set upon startup. Workspaces can be added or\n# removed while Wingo is running.\nworkspaces := 1 2 3 4 browser mail\n\n# The default layout that is used for all workspaces. Currently, the\n# only available layouts are: Floating, Vertical or Horizontal.\n# Setting this to something other than a Floating layout effectively turns\n# Wingo into a tiling window manager.\ndefault_layout := Vertical\n\n# When enabled, windows will be focused when the mouse enters the window.\n# N.B. I don't use focus follows mouse, so I'm not sure precisely how it\n# should work. If I've messed up, file a bug report.\nfocus_follows_mouse := no\n\n# If \"focus_follows_mouse\" is enabled, then this setting will focus a window\n# whenever the pointer moves into the window.\nfocus_follows_mouse_focus := yes\n\n# If \"focus_follows_mouse\" is enabled, then this setting will raise a window\n# whenever the pointer moves into the window.\nfocus_follows_mouse_raise := no\n\n# If \"focus_follows_mouse\" is enabled, then this setting will focus a new\n# window when it has been created. (Otherwise, a new window will be raised\n# but not focused.)\nfocus_follows_mouse_startup_focus := no\n\n# If enabled, head focus will follow the mouse. That is, moving the mouse to\n# another monitor will move the focus to the workspace on that monitor.\n# Note that this does not require that \"focus_follows_mouse\" be enabled;\n# however this only works when the mouse is directly over the root window.\n# (So enabling this option might be weird if \"focus_follows_mouse\" is\n# disabled.)\n#\n# N.B. It is possible that this could have an effect on performance, since\n# most pointer motion events on the root window must be inspected.\nfocus_follows_mouse_head := no\n\n# Whether error messages should be shown or not. Error messages typically\n# show up when you've tried to do something illegal with one of Wingo's\n# commands.\n# Error messages acquire focus and do not disappear until they lose focus, or\n# if the \"confirm\" or \"cancel\" keys have been pressed.\nshow_popup_errors := yes\n\n# Whether FYI messages should be shown or not. These are typically used to\n# indicate state changes, like when a the current workspace is changed.\n# Note that FYI messages only appear for a set amount of time (see \"popup_time\"\n# below) and then disappear. They never acquire focus.\nshow_popup_fyi := yes\n\n# The time that an \"FYI\" message window stays visible in milliseconds.\n# After time expires, the message disappears.\npopup_time := 500\n\n# The key that acts as the \"confirm\" key. This is mostly used in prompts. When\n# the confirm key is pressed, the prompt will execute an action corresponding\n# to the inputted text or the selected item.\nconfirm := Return\n\n# The key that acts as the \"cancel\" key. This is mostly used in prompts. When\n# the cancel key is pressed, the prompt disappears and no action occurs.\ncancel := Escape\n\n# The shell to be used to launch commands.\n# It is used like so: `SHELL -c \"{COMMAND}\"`.\n# If you need to pass additional arguments to the shell invocation, then\n# you'll need to make a wrapper script.\n# (Make sure it can handle the `-c` flag!)\nshell := bash\n\n# The program to use to play a wav file. This is only used with the \"Dale\"\n# command, which is an easter egg.\n# audio_play_cmd := aplay\n\n")
	theme = []byte( "# This file contains all theme information for Wingo. For the most part, this\n# includes changing colors, fonts, font sizes, border and icon sizes. This is\n# enough to completely configure your own color scheme for Wingo, but you won't\n# be able to make any structural changes to the window decorations.\n#\n# Wingo's configuration files are very similar to a regular INI file, except\n# that simple variable substitution is allowed. Namely, a variable can be\n# defined anywhere in the file (and re-defined) and then used in place of\n# where a value might go. You can see a few examples of using such variables\n# below.\n#\n# There two primary themeable portions of Wingo: window decorations and\n# prompts. There are four different kinds of decorations that can be configured\n# separately, and many different kinds of prompts that all use the same theme\n# configuration. The sections \"Full\", \"Borders\", and \"Slim\" correspond\n# to three of the four frame decorations (the fourth is \"Nada\" and does not\n# have any appearance, and therefore has no theme), and the \"Prompt\" section\n# corresponds to the prompt theme information.\n#\n# Here is a brief description of each kind of window decoration:\n#\n# Full      Your standard window decorations. Complete with a title bar, window\n#           icon, and buttons to minimize/maximize/close the window. This\n#           decoration is typically used on windows that are floating.\n#\n# Borders   A border decoration that is responsive to mouse input. This\n#           decoration is typically used on windows that are tiling.\n#\n# Slim      A simpler border decoration that is NOT responsive to mouse input.\n#           This decoration is typically used on windows that ask not to be\n#           decorated, but are still normal clients. (Like 'gmrun'.) The \"Slim\"\n#           decoration can be effectively disabled by setting its border size\n#           to 0.\n#\n# Nada      No decorations at all. Thus, there is no theming section for it\n#           since it has no appearance. This decoration is typically used on\n#           windows that aren't normal clients (like desktops and docks) and\n#           windows that ask not to be decorated AND specially shape their\n#           window (like Google Chrome/Chromium).\n#\n#\n# Gradients\n# ---------\n# There are four theme options below that can accept two colors, which\n# when combined, describe a gradient starting from the first color and ending\n# at the second. These options are: [Full]/a_title_color, [Full]/i_title_color,\n# [Borders]/a_border_color and [Borders]/i_border_color.\n#\n#\n# File paths\n# ----------\n# There are several options below that require you to specify a file path,\n# like fonts and images. These should always be absolute paths.\n#\n# Note that if a path is incorrect, Wingo will log a warning to stderr. More\n# importantly, none of these paths *must* be correct for Wingo to operate.\n# Wingo will fall back to embedded defaults.\n#\n# N.B. Several file paths below are relative. They are meant to serve as\n# placeholders that refer to the actual files in Wingo's git repository. In\n# actuality, Wingo will (probably) fail to find them, and fallback to embedded\n# defaults.\n#\n#\n# Naming convention\n# -----------------\n# The single letter \"a\" refers to an \"active\" state and the single letter \"i\"\n# refers to an \"inactive\" state.\n#\n#\n# Miscellaneous\n# -------------\n# The only option here is a path to the default Wingo icon. This is used for\n# windows that don't specify an icon.\n\n$THIN_COLOR := 0x585a5d\n\n[Full]\nfont := DejaVuSans.ttf\nfont_size := 16\na_font_color := 0xffffff\ni_font_color := 0x000000\n\ntitle_size := 27\na_title_color := 0xd66b00 0xff9123\ni_title_color := 0xffffff\n\nborder_size := 4\na_border_color := $THIN_COLOR\ni_border_color := $THIN_COLOR\n\n$ACTIVE_BUTTON := 0xffffff\n$INACTIVE_BUTTON := 0x000000\n\nclose := data/close.png\na_close_color := $ACTIVE_BUTTON\ni_close_color := $INACTIVE_BUTTON\n\nmaximize := data/maximize.png\na_maximize_color := $ACTIVE_BUTTON\ni_maximize_color := $INACTIVE_BUTTON\n\nminimize := data/minimize.png\na_minimize_color := $ACTIVE_BUTTON\ni_minimize_color := $INACTIVE_BUTTON\n\n[Borders]\nborder_size := 4\na_thin_color := $THIN_COLOR\ni_thin_color := $THIN_COLOR\na_border_color := 0xff7f00\ni_border_color := 0xdfdcdf\n\n[Slim]\nborder_size := 1\na_border_color := 0x000000\ni_border_color := 0x000000\n\n[Prompt]\nbg_color := 0x8e8e8e\nborder_color := 0x585a5d\nborder_size := 8\npadding := 15\nfont := DejaVuSans.ttf\nfont_size := 17\nfont_color := 0xffffff\nselect_active_color := 0x4c4c4c\nselect_active_bg_color := 0xffffff\nselect_group_bg_color := 0x8e8e8e\nselect_group_font := DejaVuSans.ttf\nselect_group_font_size := 25\nselect_group_font_color := 0xffffff\ncycle_icon_size := 64\ncycle_icon_border_size := 8\n\n# 0 = completely transparent, 100 = completely opaque\ncycle_icon_transparency := 30\n\n[Misc]\n# This is the default icon to use for windows that don't specify an icon.\ndefault_icon := data/wingo.png\n\n")
